import React, { Component } from 'react'
import { Card } from 'semantic-ui-react'
import { Link,BrowserRouter as Router,Route } from 'react-router-dom'
import showDeployedTender from '../components/showDeployedTender';

export default class TenderLogs extends Component {
 
    constructor(props) {
      super(props);
    }
   
   
  render() {
    return (
      <div className='ui  container center'>
        <h1>TenderLogs</h1>
        <Card>
        <Card.Content>
        <Card.Header>{this.props.address}</Card.Header>
        <Card.Meta>Deployed Tender Address</Card.Meta>
        <Card.Description>
         <Link to='.tenderlog/tenderstatus'>view details</Link> 
        </Card.Description>
      </Card.Content>
      </Card>
    

    <Router>
      <Route path='./tenderlog/tenderstatus'>
        <showDeployedTender
         address={this.props.address}
         contract={this.props.contract}
         account={this.props.account}
         web3={this.props.web3}
         />
      </Route>
    </Router>
        </div>
    )
  }
}
